import React, { Component, Fragment } from "react";
import axios from "axios";
import { Table } from "react-bootstrap";

class App extends Component {
	constructor() {
		super();
		this.state = {};
	}
	componentWillMount() {
		axios.get("/dogs").then(res => {
			this.setState({ dogs: res.data });
		});
	}

	render() {
		const handleDelete = (e, id) => {
			axios.delete("/dogs/" + id).then(res => console.log(res));
		};
		return (
			<Fragment>
				<div className="container">
					<Table striped bordered hover variant="dark">
						<thead>
							<tr>
								<th>#</th>
								<th>Dog Name</th>
								<th>Dog Owner</th>
								<th>Notes</th>
							</tr>
						</thead>
						<tbody>
							{this.state.dogs.map(dog => {
								return (
									<tr key={dog.id}>
										<td>{dog.id}</td>
										<td>{dog.name}</td>
										<td>{dog.owner}</td>
										<td>{dog.notes}</td>
										<td>
											<a className="btn btn-primary" href={"/dogs/" + dog.id}>
												Edit
											</a>
										</td>
										<td>
											<a
												className="btn btn-danger"
												href="#"
												onClick={() => handleDelete(dog.id)}
											>
												Delete
											</a>
										</td>
									</tr>
								);
							})}
							<tr>
								<td>1</td>
								<td>Mark</td>
								<td>Otto</td>
								<td>@mdo</td>
							</tr>
							<tr>
								<td>2</td>
								<td>Jacob</td>
								<td>Thornton</td>
								<td>@fat</td>
							</tr>
							<tr>
								<td>3</td>
								<td colSpan="2">Larry the Bird</td>
								<td>@twitter</td>
							</tr>
						</tbody>
					</Table>
					;
				</div>
			</Fragment>
		);
	}
}

export default App;
